import React from 'react'
import styles from './styles.module.scss'

const MainSliderItem = ({images, text, bg}) => {
  console.log("MainSliderItem -> bg", bg)
  return (
    <div className={styles.main_slider_item} style={'background: #000;'}>
      {images}
      <h3>
        {text}
      </h3>
    </div>
  )
}

export default MainSliderItem
